/* 3. main function (old API) */
int /* [out] (0 = unknown, 1 = true, 2 = false, 3 = error) */
  monitor4
    (long state,       /* [in] */
     int  reset,       /* [in] (0 = none, 1 = hard, 2 = soft) */
     int *current_loc) /* [in/out] */
{
  long states[1], base = 1L;

  states[0] = (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;
  state >>= 1;
  base <<= 1;
  states[0] += (state % 2L) * base;

  return monitor4_ex (states, 1, reset, current_loc);
}

/* internal function (no input filtering) */
static RV_value monitor4_internal
  (long    *inputs,      /* [in] */
   size_t   width,       /* [in] (min: 1) */
   RV_reset reset,       /* [in] */
   int     *current_loc) /* [in/out] */
{
  /* local variables */
  trans_t *table, key, *result; /* for bsearch() */
  size_t size;                  /* for bsearch() */
  RV_value output;

  /* validate inputs (part 1) */
  if (NULL == current_loc) {
    return RV_INVALID_LOC;
  }

  /* handle resets */
  if (HARD_RESET == reset) {
    *current_loc = 1; /* initial location */
  }

  /* validate inputs (part 2) */
  if (*current_loc <= 0 || *current_loc > 1025) {
    return RV_INVALID_LOC;
  }
  if (width < 1) return RV_INVALID_ARG;

  if (SOFT_RESET == reset) {
    int i = *current_loc;
    *current_loc = reset_table[i];
  }

  /* perform binary search */
  table = data_table[*current_loc];
  size = size_table[*current_loc];
  if (0 == size) {
    result = NULL;
  } else {
    key.input = inputs[0];
    result = (trans_t *)bsearch(&key, table, size, sizeof(trans_t), data_cmp);
  }
  if (result) {
    output = result->output;
    *current_loc = result->next_loc;
  } else {
    output = RV_ERROR;
  }

  return output;
}

/* 4. main function (new API) */
RV_value monitor4_ex
  (long    *states,      /* [in] */
   size_t   width,       /* [in] (min: 1) */
   RV_reset reset,       /* [in] */
   int     *current_loc) /* [in/out] */
{
  return monitor4_internal(states, 1, reset, current_loc);
}

/* scalar support */
typedef struct {int key; int value;} scalar_t;

static int scalar_cmp (const void *lhs, const void *rhs)
{
  const scalar_t *_lhs = (const scalar_t *)lhs;
  const scalar_t *_rhs = (const scalar_t *)rhs;

  return (_lhs -> key - _rhs -> key);
}

static scalar_t system_drone_x_map[7] = {
  {0, 0x0}, {1, 0x4}, {2, 0x2}, {3, 0x6},
  {4, 0x1}, {5, 0x5}, {6, 0x3}
};

static scalar_t system_drone_y_map[7] = {
  {0, 0x0}, {1, 0x4}, {2, 0x2}, {3, 0x6},
  {4, 0x1}, {5, 0x5}, {6, 0x3}
};

static scalar_t system_drone_speed_map[2] = {
  {1, 0x0}, {2, 0x1}
};

static scalar_t system_current_action_map[5] = {
  {up, 0x6}, {no_action, 0x4}, {right, 0x2}, {down, 0x1},
  {left, 0x0}
};

/* 5. The scalar monitor interface */
RV_value monitor4_scalar
  (monitor4_input_t *input,
   monitor4_mask_t *masks,
   RV_reset reset,
   int *current_loc)
{
  long inputs[1];
  scalar_t item, *result = NULL;
  int system_drone_x = input->system_drone_x;
  int system_drone_y = input->system_drone_y;
  int system_drone_speed = input->system_drone_speed;
  int system_current_action = input->system_current_action;
  int bit, bits;

  memset((void *)inputs, 0, 1 * sizeof(long));
  item.key = system_drone_x;
  result = (scalar_t *)bsearch(&item, system_drone_x_map, 7, sizeof(scalar_t), scalar_cmp);
  if ((scalar_t *)NULL == result) { return RV_INVALID_ARG; }
  bits = result->value;
  bit = (bits >> 2) & 1;
  inputs[0] += (bit == 1) ? 0x1L /* 2^0 */ : 0L;
  bit = (bits >> 1) & 1;
  inputs[0] += (bit == 1) ? 0x2L /* 2^1 */ : 0L;
  bit = bits & 1;
  inputs[0] += (bit == 1) ? 0x4L /* 2^2 */ : 0L;
  item.key = system_drone_y;
  result = (scalar_t *)bsearch(&item, system_drone_y_map, 7, sizeof(scalar_t), scalar_cmp);
  if ((scalar_t *)NULL == result) { return RV_INVALID_ARG; }
  bits = result->value;
  bit = (bits >> 2) & 1;
  inputs[0] += (bit == 1) ? 0x8L /* 2^3 */ : 0L;
  bit = (bits >> 1) & 1;
  inputs[0] += (bit == 1) ? 0x10L /* 2^4 */ : 0L;
  bit = bits & 1;
  inputs[0] += (bit == 1) ? 0x20L /* 2^5 */ : 0L;
  item.key = system_drone_speed;
  result = (scalar_t *)bsearch(&item, system_drone_speed_map, 2, sizeof(scalar_t), scalar_cmp);
  if ((scalar_t *)NULL == result) { return RV_INVALID_ARG; }
  bits = result->value;
  bit = bits & 1;
  inputs[0] += (bit == 1) ? 0x40L /* 2^6 */ : 0L;
  item.key = system_current_action;
  result = (scalar_t *)bsearch(&item, system_current_action_map, 5, sizeof(scalar_t), scalar_cmp);
  if ((scalar_t *)NULL == result) { return RV_INVALID_ARG; }
  bits = result->value;
  bit = (bits >> 2) & 1;
  inputs[0] += (bit == 1) ? 0x80L /* 2^7 */ : 0L;
  bit = (bits >> 1) & 1;
  inputs[0] += (bit == 1) ? 0x100L /* 2^8 */ : 0L;
  bit = bits & 1;
  inputs[0] += (bit == 1) ? 0x200L /* 2^9 */ : 0L;

  return monitor4_internal(inputs, 1, reset, current_loc);
}
